import React, { useState } from 'react';
import { Route, Switch, useParams } from 'react-router';
import Home from './Home';
import Password from './Password';

const App = () => {


    return <Switch>
        <Route path="/" exact component={Home}/>
        <Route path="/:id" component={Password} />
    </Switch>
};

export default App;
